import React from 'react';
import '../../../../App.css';

const hour = (props) => {
        return (
            <div className="card hourCard">
                <p>{props.hour}</p>
                <p>{props.temperature}</p>
                <p>{props.weather}</p>
                <p>Brzina vjetra: <span>{props.windSpeed} km/h</span></p>
            </div>

        );
}

export default hour;
